import { BrowserRouter, Route, Link } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import Header from './component/Header';

class App extends Component {
  render() {
    const resume = () => <h1>resume</h1>;
    return (
      <div>
        <a to="/">Home</a>
        <a to="/resume">1</a>

        <Route path="/resume" component={resume} />
      </div>
    );
  }
}

export default App;
